import React from 'react';

import { NavToProdBtn, ErrorBoundary } from '../components';

import napkinsImg from '../assets/napkins.webp';
import toiletsImg from '../assets/toilets.webp';

import './HomePage.css';

export const HomePage = () => {
	return (
    <ErrorBoundary>
  		<section className="home-page__container" data-theme="light">
        <nav className="home-page__navigation">        
          <li className="navigation__item">
          <NavToProdBtn link='/production/napkins' imgSrc={napkinsImg} alt='Салфетки' />
                <Button variant="outlined" color="primary" href="/">
      Назад
      </Button>
          </li>
          <li className="navigation__item"><NavToProdBtn link='/production/toilets' imgSrc={toiletsImg} alt='Туалетная бумага' /></li>
        </nav>
  		</section>
    </ErrorBoundary>
	);
}
